import React from "react"

function Recipieslist(props){ 

    const {recipeList} = props
    console.log(recipeList)

    return ( 
        <>
        {recipeList.map((item) => 
            <div className = "main-home"> 
                <img alt = "image not found" src ={`https://spoonacular.com/recipeImages/${item.id}-90x90.jpg`}></img>
                <h1 className = "rand-title">{item.title}</h1>
                <h4 className = "sub-title">Ready in{item.readyInMinutes}</h4>
                <h4 className = "sub-title">Serves {item.servings}</h4>
            </div>
                )}
        </>

    )
}

export default Recipieslist
